INSERT INTO `tb_textos` (`ID`, `texto`, `Descricao`) VALUES
	(1, '<h2>FACTU</h2>\r\n\r\n<h3>Ag&ecirc;ncia de Trade Marketing e Funcion&aacute;rios Tempor&aacute;rios</h3>\r\n\r\n<p><a class="btn-get-started scrollto" href="#secao-contato">Contate-nos</a></p>\r\n\r\n<h3>Tel.: (11) 3711-9999</h3>\r\n', 'Banner'),
	(2, '<h2><strong>SERVI&Ccedil;OS</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Terceiriza&ccedil;&atilde;o de profissionais M&atilde;o de obra terceirizada - CLT</h2>\r\n\r\n<p>&nbsp;</p>\r\n', 'Serviços'),
	(3, '<h2>Merchandising</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Promotores, Repositores, Degustadoras e Demonstradoras</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Relat&oacute;rios quantitativos e qualitativos;</li>\r\n	<li>Supervisores experientes</li>\r\n	<li>Checking fotogr&aacute;fico</li>\r\n	<li>Profissionais tempor&aacute;rios ou efetivos</li>\r\n	<li>Carga hor&aacute;ria de 44 horas semanais</li>\r\n	<li>Equipe monitorada online em tempo real</li>\r\n	<li>Encargos sociais conforme a CLT e na lei 6019/74</li>\r\n</ul>\r\n', 'Merchandising'),
	(4, '<p><h2>Terceirização de profissionais</h2></p>\r\n        <p><h3>Recrutamento e seleção de vagas operacionais, administrativas e de média e alta gerência</h3></p>\r\n        <p>Mão de obra terceirizada - CLT<br>Disponibilizamos para diversos segmentos de empresas, equipes e profissionais especializados;\r\n        <br>Mão de obra temporária - Lei 13.467/17</p>\r\n        <p>Oferecemos profissionais com contrato por tempo determinado, para atender:</p>\r\n<ul>\r\n        <li> Aumento de produção ou serviço \r\n        <li> Cobertura de férias\r\n        <li> Licença maternidade\r\n        <li> Licença paternidade\r\n        <li> Licença acidente\r\n        <li> Licença doença, entre outros\r\n</ul>', 'Terceirização'),
	(5, '<p><h2>Ação no canal de Distribuição e Varejo?</h2></p>\r\n<ul>\r\n        <li>Positivação de Merchandising</li>\r\n        <li>Varredura por região para checking de clientes</li>\r\n        <li>Teste de aceitação de produto</li>\r\n        <li>Supervisão de PDV</li>\r\n        <li>Decoração de loja</li>\r\n        <li>Pesquisa de sabor</li>\r\n        <li>Comprador misterioso</li>\r\n</ul>', 'Distribuição e Varejo'),
	(6, '<p><h2>Atendimento Nacional</h2></p>\r\n<ul>\r\n          <li>Varejo</li>\r\n          <li>Atacado</li>\r\n          <li>Magazine</li>\r\n          <li>Home Center</li>\r\n          <li>Perfumaria</li>\r\n          <li>Farma</li>\r\n          <li>Pet</li>\r\n</ul>', 'Atendimento Nacional'),
	(7, '<p><h2>Gestão Inteligente de Equipes Externas</h2></p>\r\n<ul>\r\n        <li>Roteirização eletrônica</li>\r\n        <li>Otimização e redução de custos</li>\r\n        <li>Localização dos colaboradores em tempo real</li>\r\n        <li>Agendamento de tarefas on line</li>\r\n        <li>Comunicação da equipe via chat</li>\r\n        <li>Acompanhamento das visitas e tarefas realizadas em tempo real</li>\r\n        <li>Análise da produtividade por período e por colaborador.</li>\r\n</ul>', 'Gestão Inteligente de Equipes'),
	(8, '<p>&nbsp;</p>\r\n\r\n<h2><strong>PROPAGANDA</strong></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Campanhas publicit&aacute;rias, consolida&ccedil;&atilde;o de marca, fideliza&ccedil;&atilde;o e consumidores, a&ccedil;&otilde;es promocionais, blitz e sampling. Seja inovador! Reinvente sua marca e atenda as necessidades do seu nicho de consumidores.</p>\r\n', 'Propaganda'),
	(9, '<h2><strong>PROMO&Ccedil;&Atilde;O</strong></h2>\r\n\r\n<h3>Confira abaixo alguns Destaques de nossos servi&ccedil;os Promocionais</h3>\r\n', 'Promoção'),
	(10, '<h2><strong>CLIENTES</strong></h2>\r\n', 'Clientes'),
	(11, '<div class="section-header">\r\n<h2><strong>VAGAS</strong></h2>\r\n\r\n<h3>Oportunidades de Emprego</h3>\r\n\r\n<h3><a class="btn btn-info" href="vagas.php">Clique Aqui!</a>&nbsp;e confira todas as nossas vagas dispon&iacute;veis.</h3>\r\n</div>\r\n', 'Vagas'),
	(12, '<p>&nbsp;</p>\r\n\r\n<h2><strong>LOCALIZA&Ccedil;&Atilde;O</strong></h2>\r\n\r\n<h3>Pr&oacute;x. da Esta&ccedil;&atilde;o Alto do Ipiranga&nbsp;</h3>\r\n\r\n<h3>Rua&nbsp;Eduardo Carlos Pereira, 302&nbsp; - Ipiranga - S&atilde;o Paulo - SP</h3>\r\n\r\n<h3>CEP: 04276-030&nbsp; / Tel.: (11) 3711-9999</h3>\r\n', 'Localização'),
	(13, '<h2><strong>CONTATE-NOS</strong></h2>\r\n\r\n<h3>Tel: (11)3711-9999</h3>\r\n\r\n<p>Pe&ccedil;a j&aacute; a sua proposta comercial para a Factu Trade Marketing e Funcion&aacute;rios Tempor&aacute;rios</p>\r\n', 'Contate-nos');
